const users = (state = [], action) => {
  switch (action.type) {
    case 'ADD_USER':
      return [
        ...state,
        {
          accessToken: action.accessToken,
          refreshToken: action.refreshToken
        }
      ]
    default:
      return state
  }
}

export default users
